import { useEffect, useState } from "react";



function Detail() {

    const [data, setData] = useState([])

    useEffect(() => {
        fetch("http://localhost:3005/datadetail")
            .then((res) => {
                return res.json()
            })

            .then((resp) => {
                setData(resp)
                console.log(resp)
            })
    }, [])


    return (

        <div>
             <Link to='/datadetail'>
                        <button id="d" >D</button>
                        </Link>
            {data.map((item) => (
                <div>
                     <p><img src={item.image} id="image" /> </p>
                        <h4>{item.brand}</h4>
                        <p>{item.name}</p>
                        <p>{item.color}</p>
                        <p>{item.material}</p>
                        <p>{item.display}</p>
                        <h6><i class="fa-solid fa-indian-rupee-sign"></i> {item.price}</h6>
                    
                </div>
            ))}

        </div>
    )
}
export default Detail;
